    "2016-09-23T12:13:25.305939",nt"name": "entry-on-duty-system",nt"isopen":
    true,nt"url": null,nt"notes": "EODS (CareerLauncher) is an online system
    managed by Treasury that services newly hired federal employees before they begin
    their employment at a federal site. EODS provides an automated on-boarding process
    that focuses on pre-employment on-boarding benefits forms completion and data collection
    and delivery of new hire information to prospective federal employee. The system
    pulls position data from HR Connect . The public-facing Internet portion allows
    EODS applicants to access their information via a secure connection across the internet.
    The intranet portion allows HR Specialists to administer and track applicants' benefits
    package completion and the interconnection between EODS and HR Connect.  CareerLauncher
    is the entry-on-duty system (EODS) implemented in July 2012 to help streamline the
    onboarding process and provide a much better experience for new hires entering the
    Agency. This system greatly reduces the manual effort for new hires by providing
    the package of standard forms that a new hire typically completes by hand in electronic
    form via the internet, with some prefilled information provided by the applicant
    from Monster CareerConnector. In addition, the system greatly reduces the data entry
    on the HR professional's part by automatically feeding the new hire information
    to the USAID HR personnel system.",nt"license_title": "Other License Specified",nt"extras":
